// fonts import  

//three col sec 
@import url('https://fonts.googleapis.com/css?family=Noto+Sans+JP&display=swap');

//logo
@import url('https://fonts.googleapis.com/css?family=Pacifico&display=swap');


html,
body {
  height: 200%;
  width: 100%;
  background-color: #F4F0E9;
  padding: 0;
  margin: 0;
  scroll-behavior: smooth; 
}

body {
  //overflow-x: hidden;
}
* {
  margin: 0;
  padding: 0;
  border: none; 
}
// colors

$header: rgb(248, 248, 248);
$headerDark: rgb(236, 228, 213);
$logo : #333;

// header

header.smaller {
  height: 75px;
}

header.smaller nav a {
  line-height: 75px;
}

*,
*:before,
*:after {
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
}

// header

header {
  width: 100%;
  height: 7em;
  position: fixed;
  top: 0;
  left: 0;
  z-index: 999;
  border-bottom: solid 0.5em $header;
  background-color: $header;
  transition: height 0.3s;
  z-index: 5999;
}

header h1#logo {
  display: inline-block;
  line-height: 2em;
  margin: 0;
  padding: 0 1em;
  background-color: none;
  float: left;
  font-family: 'Pacifico', cursive;
  font-size: 60px;
  color: $logo;
  text-shadow: 0.1em 0.03em rgb(216, 214, 214);
  font-weight: 400;
  -webkit-transition: all 0.3s;
  -moz-transition: all 0.3s;
  -ms-transition: all 0.3s;
  -o-transition: all 0.3s;
  transition: all 0.3s;
  z-index: 10;
}

header.smaller {
  height: 75px;
}

header.smaller h1#logo {
  line-height: 65px;
  font-size: 40px;
}

.navigation-ul {
  display: flex;
  list-style: none;
  position: absolute;
  right: 10%;
  top: 50%;
  transform: translate(-50%, -50%);


  @media screen and (max-width: 500px) {
    display: none;
  }

  
  @media screen and (min-width: 1500px) {
    transform: translate(-50%,-50%)scale(1.45);

  }


    a {
        text-decoration: none;
        color: $logo; 

        &:hover { 
            border-top: 1px solid $logo;
            border-bottom: 1px solid $logo;
        }
    }
   li {
    padding: 10px 20px;
    transform: scale(1.3);
  }
}

  //hamburger 

  #outer { 
    display: flex;
    justify-content: center;
    align-items: center;
    height: auto; 
    position: absolute;
    top: 50%;
    right : 5% ; 
    transform: translate(-50%,-50%);

    @media screen and (max-width: 500px) {
      transform: translate(-50%,-50%)scale(1.3);

    }
    

    @media screen and (max-width: 800px) {
      transform: translate(-50%,-50%)scale(1.4);

    }

    @media screen and (min-width: 1500px) {
      transform: translate(-50%,-50%)scale(1.6);

    }
    
  }
  
  .menu-icon-wrapper {
    position: relative;
    left: 0;
    top: 0;
    width: 34px;
    height: 34px;
    pointer-events: none;
    transition: 0.1s;
    svg {
      position: absolute;
      top: -18px;
      left: -18px;
      transform: scale(0.07);
      transform-origin: 0 0;
      path {
        stroke: $logo;
        stroke-width: 40px;
        stroke-linecap: round;
        stroke-linejoin: round;
        fill: transparent;
        transition: stroke-dasharray 0.5s;
        &.path1 {
          stroke-dashoffset: 5803.15px; 
          stroke-dasharray: 2901.57px, 2981.57px, 240px;
        }
        &.path2 {
          stroke-dashoffset: 800px; 
          stroke-dasharray: 400px, 480px, 240px;
        }
        &.path3 {
          stroke-dashoffset: 6993.11px; 
          stroke-dasharray: 3496.56px, 3576.56px, 240px;
        }
      }
    }
    &.open {
      svg {
        path {
          &.path1 {
            stroke-dasharray: 2901.57px, 5258.15px, 240px;
          }
          &.path2 {
            stroke-dasharray: 400px, 600px, 0px;
          }
          &.path3 {
            stroke-dasharray: 3496.56px, 6448.11px, 240px;
          }
        }
      }
    }
    .menu-icon-trigger {
      position: relative;
      width: 100%;
      height: 100%;
      cursor: pointer;
      pointer-events: auto;
      background: none;
      border: none;
      margin: 0;
      padding: 0;
    }
  }


  // navigation menu

  .navigation_menu {
    position: fixed;
    top : 0; 
    left : 0; 
    height: 100vh;
    width: 100vw;
    transform: translateY(-101%) ; 
    background-color: $header;
    z-index: 1000;
    transition: all 750ms  ease-out;

    .container { 
      height: 100%;
      width: 100%;
      position: relative;
      
      
      ul {
        position: absolute;
        top: 50%;
        left : 50%;
        transform: translate(-50%,-50%);
        text-align: center;
        list-style: none;

        li { 
          font-size: 2rem;
          margin: 50px 0 ; 
          color: $logo;
          text-transform: uppercase;

          &:hover {
            text-decoration: underline;
            color: #777;
            cursor: pointer;
          }
        }
      }
    }
  }




  //landing



  .landing {  
    width: 100%;
    overflow: hidden;
    margin: 0 ; 
    padding: 0;
    
    .bg {
      background-image: url("../background_marmo.jpg");
      background-size: cover;
      width: 100%;
      height: 100vh;
      position: relative;
    }
    .container {
      position: relative ; 
      height: 100%;
      width: 100%;
      
      .banner, .belowBanner { 
        position: absolute ; 
        left: 50%;
        top: 50%;
        transform: translate(-50%,-50%);
        color : $logo;
        font-size: 40px;
        font-weight: bold; 

        @media screen and (max-width: 500px) {
            width: 100%;
            text-align: center;
            font-size: 30px;
        }

        @media screen and (max-width: 800px) {
            width: 100%;
            text-align: center;
            font-size: 40px;
        }

              
        @media screen and (min-width: 1500px) {
          font-size: 65px;
          width: 100%;
          text-align: center;

        }



      }

      .belowBanner { 
        top : 60%; 
        font-size: 20px;

        @media screen and (max-width: 500px) {
          font-size: 16px;

        }

            
        @media screen and (min-width: 1500px) {
          font-size: 30px;
          width: 100%;
          text-align: center;

        }

      }
    }
      a {
      position: absolute;
      left: 50%;
      bottom: 10%;
      transform: translate(-50%,-50%);
      color: $logo;
      text-transform: uppercase;
      text-decoration-line: none;
      letter-spacing: 2px;
      font-weight: bold;
      padding: 10px 16px ; 
      background-color: $header; 
      color: $logo;
      border-radius: 5px;
      transition: all 200ms;

      &:hover {
          background-color: rgba(34, 34, 34, 0.376); 
        color: $header
      }

          
      @media screen and (min-width: 1500px) {
        font-size: 25px; 

      }

    }
  }


  //id for href

  #threeCol {
    width: 100%;
  }



  // three col section 

  .threeCol { 
      display: grid ; 
      grid-template-columns: auto auto auto;
      grid-template-rows: none;
      margin: 50px 0 ; 
      padding: 0 50px ; 
      border-radius: 10px;
      overflow: hidden;

      @media screen and (max-width: 500px) {
        grid-template-rows: auto auto auto;
        grid-template-columns: none;
        padding: 0 10px;

      }

      @media screen and (max-width: 800px) {
        grid-template-rows: auto auto auto;
        grid-template-columns: none;
        padding: 0 10px;

      }

      .first {
        background:  $headerDark;
      }

      .second {
        background:  $headerDark;
      }

      .third {
        background:  $headerDark;
        display: flex;
        justify-content: center;
        align-items : center;

          img {
            width: 80%;
            margin: 0 auto;
          }
      }

      p {
        width: 80% ; 
        margin: 0 auto;
        padding: 50px 0;
        line-height: 30px;
        font-size: 17px ; 
        font-family: 'Noto Sans JP', sans-serif;
 

        @media screen and (max-width: 800px) { 
          text-align: center;
        } 

        
          
      @media screen and (min-width: 1500px) {
        font-size: 25px; 
        line-height: 40px;
      }


      }
  }



  //two col section 

  .twoColSection { 
    display: grid ; 
    grid-template-columns: auto auto ; 
    grid-template-rows: none; 
    width: 90%;
    margin: 100px auto;
    overflow: hidden;


    @media screen and (max-width: 500px) {
      grid-template-rows: auto auto; 
      grid-template-columns: none; 
    }


    @media screen and (max-width: 800px) {
      grid-template-rows: auto auto; 
      grid-template-columns: none; 
    }

    

    .first { 

      text-align: center;
      margin : auto 0 ; 
      display: flex ; 
      justify-content: center;
      align-items: center;
       
          h5 { 
            font-size: 30px;
            text-transform: uppercase;
            margin: 10px 0 ; 


            @media screen and (max-width: 500px) {
              margin: 50px auto;
            }


            @media screen and (max-width: 800px) {
              margin: 50px auto;
            }

                    
            @media screen and (min-width: 1500px) {
              font-size: 50px;  
            }
          }
          p{ 
            margin: 20px auto ; 
            width: 70%;
            line-height: 28px;
            font-size: 18px;


            @media screen and (max-width: 500px) {
              margin: 50px auto;
              font-size: 20px;
              width: 90%;
              line-height: 35px;
            }
            

            @media screen and (max-width: 800px) {
              margin: 50px auto ;
              font-size: 25px;
              width: 90%;
              line-height: 35px;
            }
            
  
            @media screen and (min-width: 1500px) {
              font-size: 30px; 
              line-height: 50px;
            }
             
          } 
      }

        img {
          width: 100%;
          transform: translateY(10%)
        }

        .secondImg {
          transform: translateY(-10%)
        }
      }

      //hr

      hr { 
        display: block;
        margin-before: 0.5em;
        margin-after: 0.5em;
        margin-start: auto;
        margin-end: auto;
        overflow: hidden;
        border-style: inset;
        border-width: 1px;
        width: 70%;
        margin: 0 auto ;
    }


      // newsletter


      .newsletter {
        padding: 20px 0;

        text-align: center;


        h3 {
          font-size: 35px;
          font-weight: bold;
          letter-spacing: 3px;
          font-family: 'Noto Sans JP', sans-serif; 

          
          @media screen and (min-width: 1500px) {
            font-size: 60px; 
            line-height: 50px;
          }

        }

        input {
          margin: 60px 0 ; 
          padding: 12px 40px;
          width: 40%;
          border: 1px solid black;


          
          @media screen and (min-width: 1500px) {
            font-size: 30px; 
            line-height: 50px;
          }


        }

        button { 
          padding: 12px 40px;
          color: $header;
          background-color: $logo;
          cursor: pointer;

          
          @media screen and (min-width: 1500px) {
            font-size: 30px; 
            line-height: 50px;
          }

        }

      }


      //footer 

      footer { 
        height: 45vh ; 
        background-color: $logo ; 
        width: 100%;
        margin-top: 100px;
        color: $header;
        border-top-left-radius: 25px;
        border-top-right-radius: 25px;
        display: grid ; 
        grid-template-columns: auto auto auto auto;
        grid-template-rows: none;
        text-align: center;

        @media screen and (max-width: 500px) {
          grid-template-rows: auto auto auto auto;
          grid-template-columns: none;
          height: auto;
          padding: 20px 0;
          
        }

        @media screen and (max-width: 800px) {
          grid-template-rows: auto auto auto auto;
          grid-template-columns: none;
          height: auto; 
          
        }

        h3 {
          font-size: 20px;
          text-transform: uppercase;
          margin: 50px 0 15px 0;
          font-family: 'Courier New', Courier, monospace;
          letter-spacing: 1px;

          
          
          @media screen and (max-width: 500px) {
            font-size: 25px
          }
          
          @media screen and (max-width: 800px) {
            font-size: 32px
          }

          
          @media screen and (min-width: 1500px) {
            font-size: 30px; 
            line-height: 50px;
          }


        }

        p {
          font-size: 16px ; 
          letter-spacing: 1px;
          margin: 7px 0;
          cursor: pointer; 

          @media screen and (max-width: 500px) {
            font-size: 13px
          }

          @media screen and (max-width: 800px) {
            font-size: 17px
          }

          
          @media screen and (min-width: 1500px) {
            font-size: 20px; 
          }

          &:hover {
            text-decoration: underline;
          }
        }

         
      }





      
        // css delays 

        .logo {
          animation-delay: 900ms;
        }
        
        .fa-heart {
          animation-delay: 1250ms;
        }

        .bg , .menu {
          animation-delay: 800ms;
          animation: fadein 1400ms forwards;

          @keyframes fadein {
            0% { opacity: 0; }
            100% { opacity: 1; }
        }
        }

        .fa-shopping-cart { 
          animation-delay: 1500ms;
        }

        .landingdelay { 
          animation-delay: 700ms;
        }
